import React, { Component } from 'react';
import "./Form.css"
class Form extends Component {

  render() {
    return (
      <div>
        <div className="parent">
           <div className="child">
           </div>
           <i class="fa fa-bitcoin" style={{"fontSize":"75px","color":"white","position":"absolute","marginLeft":"44%"}}></i>
        </div>
      </div>
    );
  }
}

export default Form;
